import Header from "../assets/header";  // Correctly import Header
import ControlledCarousel from "../assets/Carousel";  // Import the carousel component

const Home = () => {
  return (
    <div className="page-container">
      <div id="header">
        <Header />
      </div>

      <div id="carousel">
        <ControlledCarousel />  {/* Ensure the component is used here */}
      </div>
    </div>
  );
};

export default Home;
